import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { AuthProvider } from "./context/AuthContext";
import Landing from "./pages/index";
import Register from "./pages/register";
import Login from "./pages/login";
import Dashboard from "./pages/dashboard";
import KYCStep1 from "./pages/kyc-step1";
import KYCStep2 from "./pages/kyc-step2";
import KYCStep3 from "./pages/kyc-step3";
import KYCStep4 from "./pages/kyc-step4";
import KYCStep5 from "./pages/kyc-step5";
import Result from "./pages/result";

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<Landing />} />
          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/kyc-step1" element={<KYCStep1 />} />
          <Route path="/kyc-step2" element={<KYCStep2 />} />
          <Route path="/kyc-step3" element={<KYCStep3 />} />
          <Route path="/kyc-step4" element={<KYCStep4 />} />
          <Route path="/kyc-step5" element={<KYCStep5 />} />
          <Route path="/result" element={<Result />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
